MERCI pour vos TRES nombreux messages cette dernière semaine 🙏

Pour les personnes me demandant encore ce qu'il m'arrive.

Je me suis malheureusement fait une rupture totale du ligament croisé enterieur la week-end dernière lors d'une compétition 😔.

La blessure fait partie du jeu, j'accepte! L'entraînement ne s'arrête pas pour autant au contraire je compte bien revenir plus forte💪.

Go bosser le haut du corps et la gym📈.

Merci à toute les personnes qui m'entoure🙏

