🏥Une semaine depuis mon opération des ligaments croisés et déjà impatiente de revenir à l'entraînement.🏃‍♀️

La rééducation commence et je suis bien déterminée à la poursuivre avec l'incroyable équipe de professionnels qui m'entoure.❤

Un grand merci également à mes sponsors pour le soutien ainsi qu'à toutes les personnes qui m'ont envoyé leurs encouragements et pensée  positives.🙏

Cette periode non pas "d'arrêt " mais d'adaptation  n'est qu'une étape de mon parcours, et je suis plus que jamais déterminée à revenir plus forte. 

Les défis font partis de la vie,et je suis prête à relever celui-ci.💪

📸 @6vet.media

